    "contracts/DefinaLand.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity >=0.8.4;

import "@openzeppelin/contracts-upgradeable/access/AccessControlEnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/utils/ERC721HolderUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableMapUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import {FINATokenInterface} from "./FINATokenInterface.sol";
import {INewDefinaCard} from "./INewDefinaCard.sol";

contract DefinaLand is AccessControlEnumerableUpgradeable, ERC721HolderUpgradeable {

    using EnumerableSetUpgradeable for EnumerableSetUpgradeable.UintSet;

    // dev address
    address public dev;

    // New Defina Card contract
    INewDefinaCard public definaCard;

    // New Defina Card contract
    FINATokenInterface public finaToken;

    // amount of FINA every 7 days
    uint256[] landReward;
    // level 0 price in FINA
    uint256[] landBasePrice;

    // FINA price increased after each purchase
    uint256 pricePerBuy;

    // stakedLandIds overtaken by user
    mapping(address => EnumerableSetUpgradeable.UintSet) private landIdsByAddr;

    // unclaimedRewards by user
    mapping(address => uint256) public unclaimedRewardsByAddr;

    // total lands
    uint256 totalLands;

    // land info
    mapping(uint256 => Land) public lands;
    struct Land {
        uint256 land_type;
        uint256 current_nft_id;
        uint256 current_level;
        address current_owner;
        uint256 current_owner_start_time;
        uint256 last_reward_time;
        uint256 landId;
    }

    struct LandInfo {
        uint256 land_type;
        uint256 current_nft_id;
        uint256 current_level;
        address current_owner;
        uint256 current_owner_start_time;
        uint256 last_reward_time;
        uint256 landId;
        uint256 reward;
    }

    uint256 rewardUint;

    modifier onlyEOA() {
        require(_msgSender() == tx.origin, "not eoa");
        _;
    }

    function initialize(address _definaCard, address _finaToken)
    external
    initializer
    {
        __AccessControlEnumerable_init();
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        definaCard = INewDefinaCard(_definaCard);
        finaToken = FINATokenInterface(_finaToken);
        dev = msg.sender;
        landReward = [30, 75, 100, 200];
        landBasePrice = [100, 200, 300, 400];
        pricePerBuy = 100;
        totalLands = 75 * 75;
        rewardUint = 1 days;
    }


    // get land type
    function getLandType(uint256 landId) public pure returns (uint256) {
        uint256 x = landId % 75;
        uint256 y = landId / 75;
        uint256 landType;
        if (x<6 || x>=69 || y<6 || y>=69){
            landType = 0;
        } else if (x<12 || x>=63 || y<12 || y>=63) {
            landType = 1;
        } else if (x<22 || x>=53 || y<22 || y>=53){
            landType = 2;
        } else {
            landType = 3;
        }
        return landType;
    }

    function overTakeMulti(uint256[] calldata landIds) external onlyEOA {
        for (uint256 i = 0; i < landIds.length; ++i) {
            overtake(landIds[i]);
        }
    }

    function overtake(uint256 landId) public onlyEOA {
        require(landId < totalLands, "DefinaLand: Invalid landId");
        //不能是空地址
        if (lands[landId].current_owner != address(0)) {
            require(block.timestamp - lands[landId].current_owner_start_time > 1 * rewardUint, "DefinaLand: The land is under 24 hours protection"); //保护罩机制
            // set old owner data
            landIdsByAddr[lands[landId].current_owner].remove(landId);
            unclaimedRewardsByAddr[lands[landId].current_owner] += calculateRewards(landId);
        }
        lands[landId].land_type = getLandType(landId);
        uint256 price = landBasePrice[lands[landId].land_type] + lands[landId].current_level * pricePerBuy;
        // 10% fina for dev team
        finaToken.transferFrom(msg.sender, dev, price * 1 ether * 10 / 100 );
        finaToken.transferFrom(msg.sender, address(this), price * 1 ether * 90 / 100);

        // set new owner data
        landIdsByAddr[msg.sender].add(landId);
        // update land info
        lands[landId].current_level ++;
        lands[landId].current_owner = msg.sender;
        lands[landId].current_owner_start_time = block.timestamp;
        lands[landId].last_reward_time = block.timestamp;
    }

    function calculateRewards(uint256 landId) public view returns (uint256) {
        uint256 stakedTime = (block.timestamp - lands[landId].last_reward_time);
        uint256 rewardPercent = 0;
        // no reward if less than 5 days
        if (stakedTime < 5 * rewardUint) {
            rewardPercent = 0;
        // 30% reward if between 5-7 days
        } else if (stakedTime < 7 * rewardUint) {
            rewardPercent = 30;
        // 100% reward if more than 7 days
        } else {
            rewardPercent = 100;
        }
        Land memory land =lands[landId];
        return (land.current_level * landReward[land.land_type] * rewardPercent) / 100;
    }

    function calculateRewardsAll(address user)public view returns (uint256) {
        uint256 totalRewards = unclaimedRewardsByAddr[user];
        uint length = landIdsByAddr[user].length();
        for (uint i = 0; i < length; i++) {
            uint256 landId = landIdsByAddr[user].at(i);
            totalRewards += calculateRewards(landId);
        }
        return totalRewards;
    }

    function claimRewards(uint256 landId) external onlyEOA{
        require(msg.sender == lands[landId].current_owner, "DefinaLand: msg.sender is not the land owner");
        // no profit if less than 5 days
        if (block.timestamp - lands[landId].current_owner_start_time >= 5 * rewardUint) {
            uint256 rewards= calculateRewards(landId);
            lands[landId].last_reward_time = block.timestamp;
            // 5% fina for dev team
            uint256 balance = finaToken.balanceOf((address(this)));
            if (balance >= rewards * 1 ether) {
                finaToken.transfer(dev, rewards * 1 ether * 5 / 100);
                finaToken.transfer(msg.sender, rewards * 1 ether * 95 / 100);
//                unclaimedRewardsByAddr[msg.sender] = 0;
            } else {
                finaToken.mint(dev, rewards * 1 ether * 5 / 100);
                finaToken.mint(msg.sender, rewards * 1 ether * 95 / 100);
//                unclaimedRewardsByAddr[msg.sender] = 0;
            }
        }
    }

    function claimRewardsAll() external onlyEOA {
        uint256 totalRewards = unclaimedRewardsByAddr[msg.sender];
        uint length = landIdsByAddr[msg.sender].length();
        for (uint i = 0; i < length; i++) {
            uint256 landId = landIdsByAddr[msg.sender].at(i);
            // no profit if less than 5 days
            if (block.timestamp - lands[landId].current_owner_start_time >= 5 * rewardUint) {
                require(msg.sender == lands[landId].current_owner, "DefinaLand: msg.sender is not the land owner");
                totalRewards += calculateRewards(landId);
                lands[landId].last_reward_time = block.timestamp;
            }
        }
        uint256 balance=finaToken.balanceOf((address(this)));
        // 5% fina for dev team
        if (balance >= totalRewards * 1 ether) {
            finaToken.transfer(dev, totalRewards * 1 ether * 5 / 100);
            finaToken.transfer(msg.sender, totalRewards * 1 ether * 95 / 100);
            unclaimedRewardsByAddr[msg.sender] = 0;
        } else {
            finaToken.mint(dev, totalRewards * 1 ether * 5 / 100);
            finaToken.mint(msg.sender, totalRewards * 1 ether * 95 / 100);
            unclaimedRewardsByAddr[msg.sender] = 0;
        }
    }

    function withdrawMulti(uint256[] calldata landIds) external onlyEOA {
        for (uint i = 0; i < landIds.length; i++) {
            withdraw(landIds[i]);
        }
    }

    function withdraw(uint256 landId) public onlyEOA {
        require(msg.sender == lands[landId].current_owner, "DefinaLand: msg.sender is not the land owner");
        uint256 rewards = calculateRewards(landId);
        lands[landId].last_reward_time = block.timestamp;
        // 5% fina for dev team
        uint256 balance = finaToken.balanceOf((address(this)));
        if (balance >= rewards * 1 ether){
            finaToken.transfer(dev, rewards * 1 ether * 5 / 100);
            finaToken.transfer(msg.sender, rewards * 1 ether * 95 / 100);
        } else {
            finaToken.mint(dev, rewards * 1 ether * 5 / 100);
            finaToken.mint(msg.sender, rewards * 1 ether * 95 / 100);
        }
        landIdsByAddr[lands[landId].current_owner].remove(landId);
        lands[landId].current_owner = address(0);
        lands[landId].current_owner_start_time = 0;
        lands[landId].last_reward_time = 0;
        uint level=lands[landId].current_level-1;
        if (level < 0) {
            level=0;
        }
        lands[landId].current_level=level;
    }

//    function getLandIdsByAddr2(address  user) public view returns(uint256[] memory landIds){
//        uint length = landIdsByAddr[user].length();
//        uint256[] memory result=new uint256[](length);
//        for (uint i = 0; i < length; i++) {
//            uint256 landId = landIdsByAddr[user].at(i);
//            result[i]=landId;
//        }
//        return result;
//    }

    function transferAdmin(address account)
    external
    onlyRole(DEFAULT_ADMIN_ROLE)
    {
        grantRole(DEFAULT_ADMIN_ROLE, account);
        revokeRole(DEFAULT_ADMIN_ROLE, _msgSender());
    }

    /*
     * @dev Pull out all balance of tokens wrongly transferred to this contract, including Eth.
     */
    function pullFunds(address tokenAddress_)
    external
    onlyRole(DEFAULT_ADMIN_ROLE)
    {
        if (tokenAddress_ == address(0)) {
            (bool success, ) = _msgSender().call{value: address(this).balance}(
                ""
            );
            require(success, "DefinaLand: Withdrawal failed");
        } else {
            FINATokenInterface token = FINATokenInterface(tokenAddress_);
            token.transfer(_msgSender(), token.balanceOf(address(this)));
        }
    }

    function getLandsIndex(uint256 startIndex, uint256 endIndex) public view returns (Land[] memory) {
        require(endIndex>startIndex,"endIndex must gather than startIndex");
        Land[] memory landsArray = new Land[](endIndex-startIndex);
        uint256 index=0;
        for (uint256 i = startIndex; i < endIndex; i++) {
            Land memory landTem = lands[i];
            landTem.landId=i;
            landsArray[index] = landTem;
            index+=1;
        }
        return landsArray;
    }

    function getLandsByAddress(address user) public view returns(LandInfo[]memory) {
        uint length=landIdsByAddr[user].length();
        LandInfo[] memory result=new LandInfo[](length);
        if (length <= 0){
            return result;
        }
        for(uint i = 0; i < length; i++){
            uint256 landId=landIdsByAddr[user].at(i);
            Land memory temp  = lands[landId];
            result[i].land_type=temp.land_type;
            result[i].current_level=temp.current_level;
            result[i].current_owner=temp.current_owner;
            result[i].current_owner_start_time=temp.current_owner_start_time;
            result[i].last_reward_time=temp.last_reward_time;
            result[i].landId=landId;
            uint256 reward=calculateRewards(landId);
            result[i].reward=reward;
        }
        return result;
    }
}
"
    },
